post_content:
جوکر دلقکی نه چندان شوخ!

در مقابل ابرقهرمان ها شخصیت هایی هستند که ناچار یا به انتخاب نویسنده شخصیت و سرنوشتشان منفی ابراز میشود. زندگی شخصی این افراد هم هیاهویی کمتر از قهرمانان ندارند اما جدال های این شخصیت ها بیشتر از ابر قهرمان ها با خودشان است.

&nbsp;

مون بلان به معنای کوه سفید از قله های معروف اورپا و از کوه های مورد علاقه کوهنوردان است.

مون بلان برند آلمانی است که ساعت، لوازم تحریر و جواهرات تولید می‌کند.

&nbsp;
